import React from "react";

// react-router-dom Imports
import { Link } from 'react-router-dom';

function Header() {
  return (
   <nav className="headerContainer">
    <Link to="/">
    <a href="#">Home</a> |
    </Link>
    <Link to="/team">
    <a href="#">Your Team</a> |
    </Link>
    <Link to="/signin">
    <button>Sign in</button>
    </Link>
    <Link to="/signup">
    <button>Sign up</button>
    </Link>
    {/* <a href="#">Battle</a> |
    <a href="#">Add a Hero</a> */}
   </nav>
  );
}

export default Header;
